style.css:
@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document domain("law.com") {

/*text&background*/

html, body, tbody, thead, th, tr, td, blockquote, li, ul, h1, h2, h3, h4, h5, h6, p, form, #footer, #foothead_container, #icfooter, #letterSection

{
color: white !important;
background: black !important;
}

/*links*/

a

{
color: #0040ff !important;
}

ul#global_tabs li a, #global_tabs #nav li a, #global_tabs #nav li .box, div.tabbox_inner, .scrollable .items, div#carousel_container div.one_col, div#lawfooter

{
background: black !important;
}

/*highlight*/

textarea, pre, #txtTyped

{
background: #333333 !important;
}

}
